import React from "react";
import Netflix from "./Netflix";
import Amazon from "./Amazon";

const FavSeries = "netflix";


const App = () => (
  <>
  <h1 className="heading_style">List of top 5 Netflix Series in 2023</h1>
    { FavSeries === 'netflix' ? <Netflix/> : <Amazon/>}
  </>
);

export default App;
